   "source": [
    "# Задание 5\n",
    "\n",
    "install.packages(c(\"MCMCpack\", \"tidyverse\"), repos = \"https://cloud.r-project.org\")\n",
    "\n",
    "library(dplyr)\n",
    "library(tidyr)\n",
    "library(MCMCpack)\n",
    "\n",
    "data <- read.csv2(\"/kaggle/input/basic-regression-learning-dataset/Agricultion_Production.csv\")\n",
    "\n",
    "df <- data %>%\n",
    "  transmute(\n",
    "    Profit = as.numeric(gsub(\",\", \".\", Profit)),\n",
    "    Humidity = as.numeric(gsub(\",\", \".\", Humidity))\n",
    "  ) %>%\n",
    "  drop_na()\n",
    "\n",
    "str(df)\n",
    "summary(df)\n",
    "\n",
    "bayes_model <- MCMCregress(\n",
    "  Profit ~ Humidity,\n",
    "  data = df,\n",
    "  burnin = 500,\n",
    "  mcmc = 3000,\n",
    "  thin = 5\n",
    ")\n",
    "\n",
    "summary(bayes_model)\n",
    "HPDinterval(bayes_model)\n",
    "\n",
    "\n",
    "X <- model.matrix(Profit ~ Humidity, data = df)\n",
    "beta_hat <- colMeans(bayes_model)[colnames(X)]\n",
    "\n",
    "df$Profit_pred <- as.numeric(X %*% beta_hat)\n",
    "\n",
    "# Метрики качества\n",
    "RMSE <- sqrt(mean((df$Profit - df$Profit_pred)^2))\n",
    "MAE  <- mean(abs(df$Profit - df$Profit_pred))\n",
    "\n",
    "RMSE\n",
    "MAE\n"
   ]
  },
