   "source": [
    "По факту, коэффициент при humidity получился отрицательным, получается что при росте влажности прибыль незначительно уменьшается. Но диапазон, в котором может быть этот коэффициент включает ноль, поэтому зависимость слабая, либо ее вообще нет. Свободный член положительный и статистически значимый. Качество модели неочень, rmse 4.6 и mape 2.44 высоковаты, модель плохо предсказывает значения прибыли. "
