    "# Задание 6\n",
    "# ================================\n",
    "# City Parameters: подготовка данных\n",
    "# ================================\n",
    "library(dplyr)\n",
    "library(ggplot2)\n",
    "\n",
    "city <- read.csv2(\"/kaggle/input/basic-regression-learning-dataset/City_Parameters.csv\")\n",
    "\n",
    "df_city <- city %>%\n",
    "  transmute(\n",
    "    Major_Crime = as.numeric(gsub(\",\", \".\", Major_Crime)),\n",
    "    Gini = as.numeric(gsub(\",\", \".\", Gini))\n",
    "  ) %>%\n",
    "  drop_na()\n",
    "\n",
    "str(df_city)\n",
    "summary(df_city)\n",
    "\n",
    "ggplot(df_city, aes(x = Gini, y = Major_Crime)) +\n",
    "  geom_point(alpha = 0.6) +\n",
    "  labs(\n",
    "    title = \"Зависимость уровня преступности от коэффициента Джини\",\n",
    "    x = \"Gini\",\n",
    "    y = \"Major Crime\"\n",
    "  ) +\n",
    "  theme_minimal()\n"
   ]
  },
