   "source": [
    "library(dplyr)\n",
    "library(ggplot2)\n",
    "\n",
    "city <- read.csv2(\"/kaggle/input/basic-regression-learning-dataset/City_Parameters.csv\")\n",
    "\n",
    "df_city <- city %>%\n",
    "  transmute(\n",
    "    Major_Crime = as.numeric(gsub(\",\", \".\", Major_Crime)),\n",
    "    Gini = as.numeric(gsub(\",\", \".\", Gini))\n",
    "  ) %>%\n",
    "  drop_na()\n",
    "\n",
    "str(df_city)\n",
    "summary(df_city)\n",
    "\n",
    "# ================================\n",
    "# Модели регрессии\n",
    "# ================================\n",
    "\n",
    "# Линейная модель\n",
    "m1 <- lm(Major_Crime ~ Gini, data = df_city)\n",
    "\n",
    "# Квадратичная модель\n",
    "m2 <- lm(Major_Crime ~ Gini + I(Gini^2), data = df_city)\n",
    "\n",
    "# Логарифмическая модель\n",
    "# добавляем маленькое число, чтобы избежать log(0)\n",
    "m3 <- lm(Major_Crime ~ log(Gini + 0.001), data = df_city)\n",
    "\n",
    "summary(m1)\n",
    "summary(m2)\n",
    "summary(m3)\n",
    "\n",
    "\n",
    "models_quality <- data.frame(\n",
    "  Model = c(\"Linear\", \"Quadratic\", \"Logarithmic\"),\n",
    "  R2 = c(summary(m1)$r.squared,\n",
    "         summary(m2)$r.squared,\n",
    "         summary(m3)$r.squared),\n",
    "  Adj_R2 = c(summary(m1)$adj.r.squared,\n",
    "             summary(m2)$adj.r.squared,\n",
    "             summary(m3)$adj.r.squared)\n",
    ")\n",
    "\n",
    "models_quality\n"
   ]
  },
