    "# Оставляем нужные переменные\n",
    "df_hr <- hr %>%\n",
    "  transmute(\n",
    "    MonthlyIncome = as.numeric(MonthlyIncome),\n",
    "    HourlyRate = as.numeric(HourlyRate)\n",
    "  ) %>%\n",
    "  drop_na()\n",
    "\n",
    "\n",
    "hr_model <- lm(MonthlyIncome ~ HourlyRate, data = df_hr)\n",
