    "RMSE <- sqrt(mean((df_hr$MonthlyIncome - df_hr$Income_pred)^2))\n",
    "MAE  <- mean(abs(df_hr$MonthlyIncome - df_hr$Income_pred))\n",
    "\n",
    "RMSE\n",
    "MAE\n"
